import './Form.css';
import React, {useRef} from "react";
import {useDispatch} from "react-redux";
import axios from "axios";
import {Login} from "../../../../../redux/ActionCreators";
import LoginFormAction from "../../../../../redux/actions/LoginFormActions";
import LoginFormActions from "../../../../../redux/actions/LoginFormActions";


const Form = () => {
	let dispatch = useDispatch()

	const authenticate = () => {
		axios.post('http://192.168.100.8:8080/api/v1/auth/token/login/', {
			'username': 'adm1',
			'password': 'adm1',
		})
			.then(response => dispatch(Login(response.data.auth_token)))
			.catch(error => console.log(`FAIL ${error}`))
	}

	const update = (e, action) => {
		console.log(e.target.value)
		switch (action) {
			case LoginFormAction.USERNAME: break
			case LoginFormAction.PASSWORD: break
		}
	}

	return <div className="form_login">
			<input type='text' id='login_username'
				   onChange={ e => update(e, LoginFormAction.USERNAME) }/>

			<input type='password' id='login_password'
				   onChange={ r => update(e, LoginFormAction.PASSWORD) }/>
		</div>
}

export default Form;
